import "./Navbar.css";
const Navbar = () => {
  return (
    <div className="navbar jus">
      <ul className="navbar-link-list d-flex justify-content-start">
        <li className="mr-5 mt-2">Home</li>
        <li className="ml-5 mt-2">Profile</li>
      </ul>
    </div>
  );
};
export default Navbar;
